// App.js
import React, { Fragment } from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  useNavigate,
  Link,
  Outlet,
  useParams,
} from 'react-router-dom';
import Registration from './components/Registration';
import ChildrenList from './components/ChildList';
import ChildProfile from './components/ChildProfile';
import {Container, Nav, Navbar} from 'react-bootstrap';



const App = () => {
  return (

    <>
    <Navbar bg="dark" data-bs-theme="dark">
        {/* <Container> */}
          <Navbar.Brand href="#home">Children's Registration Prototype</Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link href="/">Home</Nav.Link>

            <Nav.Link href="/children-list">See Registered Children</Nav.Link>
          </Nav>
        {/* </Container> */}
      </Navbar>
    <Routes>
        <Route path="/" element={<Registration />} />
        <Route path="/children-list" element={<ChildrenList />} />
        <Route path="/child-profile/:childId" element={<ChildProfile />} />
      </Routes></>






  );
};

export default App;
